  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Montezuma
  National Wildlife Refuge outlines Refuge accomplishments during the 1996 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses management planning, public
  participation, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, manpower programs, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, forests, grasslands, fire management, and wilderness
  areas. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, animal control, marking and bird banding, and disease control. The
  public uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, trapping, wildlife observation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, and energy
  conservation. Items of interest are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
